import React, { useState } from 'react';
import './FAQ.css';

const FAQ = () => {
  const [activeIndex, setActiveIndex] = useState(null);

  const toggleFAQ = (index) => {
    setActiveIndex(activeIndex === index ? null : index);
  };

  const faqData = [
    { question: "What services does Brick Tech Contracting Corp provide?", answer: "We offer a range of construction services including masonry, roofing, waterproofing, power washing, and more." },
    { question: "How can I contact Brick Tech Contracting Corp?", answer: "You can contact us via email at contact@bricktech.com or call us at (123) 456-7890." },
    { question: "What areas does Brick Tech Contracting Corp serve?", answer: "We serve clients in Brooklyn, Queens, and the entire NYC area." },
    { question: "How do I choose the right general contractor for my construction project in NYC?", answer: "To choose the right general contractor in NYC, consider their experience, credentials, client reviews, and the range of services they offer. Schedule consultations to discuss your project and assess their communication and project management skills." },
    { question: "Where does Brick Tech Contracting Corp operate?", answer: "Brick Tech Contracting Corp operates throughout New York City and the surrounding areas." },
    { question: "Is Brick Tech Contracting Corp a licensed contractor?", answer: "Yes, we are a fully licensed construction company in NYC." },
    { question: "Is Brick Tech Contracting Corp insured?", answer: "Yes, we are fully insured to ensure your peace of mind and the utmost protection for your investment." },
    { question: "Can Brick Tech Contracting Corp handle both commercial and residential projects?", answer: "Yes, we have extensive experience in handling both commercial and residential construction projects." }
  ];

  return (
    <section className="faq-section">
      <h2>Frequently Asked Questions for Brick Tech Contracting Corp</h2>
      <h3>General Contractor Services in NYC and Surrounding Areas</h3>
      <div className="faq-container">
        {faqData.map((item, index) => (
          <div key={index} className="faq-item">
            <div className={`faq-question ${activeIndex === index ? 'active' : ''}`} onClick={() => toggleFAQ(index)}>
              <span>{item.question}</span>
              <span className="faq-icon">{activeIndex === index ? '▾' : '▸'}</span>
            </div>
            {activeIndex === index && <div className="faq-answer">{item.answer}</div>}
          </div>
        ))}
      </div>
    </section>
  );
};

export default FAQ;
